const Register = ({
  title = 'Formulário de Cadastro',
  description = 'Cadastre aqui suas perguntas e respostas.'
}) => {
  return (
    <>
      <S.Wrapper>
        <S.Title>{title}</S.Title>
        <S.Description>{description}</S.Description>
      </S.Wrapper>
    </>
  )
}
export default Register
